const axios = require('axios');

interface IGenero {
    id: number;
    name: string;
}

export interface IGeneros extends Array<IGenero> {}

export const getGeneros = (): IGeneros => {
    const generos: IGeneros = [];

    axios
        .get('http://localhost:3001/generos')
        .then((response: any) => {
            console.log(response.data.genres);
        })
        .catch((error: any) => {
            console.log(error);
        });

    return generos;
};
